import React from 'react';
import styled from 'styled-components';

export default function Intro() {
  return (
    <div>
      <Warpper>
        <Date>2024 04 28</Date>
      </Warpper>
    </div>
  );
}

const Warpper = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Date = styled.h1`
  color: var(--color-main);
  width: 8rem;
  height: 3rem;
  border: 1px solid;
  border-radius: 100%;
  line-height: 3rem;
  text-align: center;
`;
